	public static bool CanRead(string path)
	{
		bool flag = false;
		bool flag2 = false;
		DirectorySecurity accessControl = Directory.GetAccessControl(path);
		if (accessControl == null)
		{
			return false;
		}
		AuthorizationRuleCollection accessRules = accessControl.GetAccessRules(includeExplicit: true, includeInherited: true, typeof(SecurityIdentifier));
		if (accessRules == null)
		{
			return false;
		}
		foreach (FileSystemAccessRule item in accessRules)
		{
			if ((FileSystemRights.Read & item.FileSystemRights) == FileSystemRights.Read)
			{
				if (item.AccessControlType == AccessControlType.Allow)
				{
					flag = true;
				}
				else if (item.AccessControlType == AccessControlType.Deny)
				{
					flag2 = true;
				}
			}
		}
		if (flag)
		{
			return !flag2;
		}
		return false;
	}

